```java
import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.assertEquals;
import static org.junit.jupiter.api.Assertions.assertThrows;

public class CalculatorTest {

    private Calculator calculator = new Calculator();

    @Test
    public void testAddInts() {
        int result = calculator.add(5, 3);
        assertEquals(8, result);
    }

    @Test
    public void testSubtractInts() {
        int result = calculator.subtract(5, 3);
        assertEquals(2, result);
    }

    @Test
    public void testMultiplyInts() {
        int result = calculator.multiply(5, 3);
        assertEquals(15, result);
    }

    @Test
    public void testDivideInts() {
        int result = calculator.divide(10, 2);
        assertEquals(5, result);
    }

    @Test
    public void testAddFloats() {
        float result = calculator.add(5.5f, 3.3f);
        assertEquals(8.8f, result);
    }

    @Test
    public void testSubtractFloats() {
        float result = calculator.subtract(5.5f, 3.3f);
        assertEquals(2.2f, result);
    }

    @Test
    public void testMultiplyFloats() {
        float result = calculator.multiply(5.5f, 3.3f);
        assertEquals(18.15f, result);
    }

    @Test
    public void testDivideFloats() {
        float result = calculator.divide(10.0f, 2.0f);
        assertEquals(5.0f, result);
    }

    @Test
    public void testDivideByZeroIntegers() {
        assertThrows(ArithmeticException.class, () -> calculator.divide(10, 0));
    }

    @Test
    public void testDivideByZeroFloats() {
        assertThrows(ArithmeticException.class, () -> calculator.divide(10.0f, 0.0f));
    }
}
```

Note that we use `float` for the floating point operations to avoid precision issues when using `double`.

We also cover the case where we divide by zero in the `divideInts()` and `divideFloats()` tests, and verify that it throws an `ArithmeticException`. 

Additionally, for integer division, we don't get any special behavior with Java's integer type, because it will be "promoted" to a `long` in the division calculation if necessary.

